import React from 'react';
import s from './Proficiency.module.css';

function Proficiency (){
    return(
        <div>
            <div className={s.left_div}>
            {/*header*/}
            <span id={s.header}>Տիրապետում</span>
            <br />
            <span>HTML CSS</span>
            <br />
            <progress id="file" value="85" max="100"></progress>
            <span>JavaScript</span>
            <br />
            <progress id="file" value="60" max="100"></progress>
            <span>Jquery</span>
            <br />
            <progress id="file" value="60" max="100"></progress>
            <span>React</span>
            <br />
            <progress id="file" value="30" max="100"></progress>
            <span>Wordpress</span>
            <br />
            <progress id="file" value="30" max="100"></progress>
        </div>
        </div>
    );
}

export default Proficiency;
